// import logo from './logo.svg';
import './App.css';

const Task = (value) => {
  return (
    <li className=''>{value}</li>
  );
}

function App() {
  const arrToDoList = ['Tarefa 1', 'Tarefa 2', 'Tarefa 3', 'Tarefa 4', 'etc...']
  return (
    <main>
      {arrToDoList.map((e, index) => {
        return(
          <ol key={index}>
            {Task(e)}
          </ol>
        )
      })}
    </main>
);
}

export default App;
